import React from 'react';
import StockPopup from '../components/streams/StockPopup';
import { connect } from 'react-redux';
import { getStocks } from '../actions';
import stock from '../apis/stock';


class Deposits extends React.Component{
  state = {
    date: [],
    open: [],
    high: [],
    low: [],
    close:[],
    adjustedclose:[],
    volume:[],
    divident:[],
    coefficient:[]

  }  
populateData = () => {
  console.log(this.props.currentCompany);
}
  render(){
    return (
        <button onClick ={this.populateData}>CLick</button>
      );
  }
}

const mapStateToProps = (state) => {
  return {
    historics:state.stocks.companyInfo,
    currentCompany:state.stocks.currentCompany
  };
};

export default connect(
  mapStateToProps,
  { getStocks }
)(Deposits);
